import React, { useState, useEffect } from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import './Navbar.css';

// Import icons
import homeIcon from '../../../public/icons/home.png';
import searchIcon from '../../../public/icons/search.png';
import cartIcon from '../../../public/icons/cart.png';
import chatIcon from '../../../public/icons/chat.png';
import userIcon from '../../../public/icons/user.png';
import logoutIcon from '../../../public/icons/logout.png';

const Navbar = () => {
  const { currentUser, logout } = useAuth();
  const [cartCount, setCartCount] = useState(0);
  const navigate = useNavigate();
  
  // Update cart count from localStorage
  useEffect(() => {
    const updateCartCount = () => {
      const cart = JSON.parse(localStorage.getItem('cart')) || [];
      const totalItems = cart.reduce((sum, item) => sum + (item.quantity || 1), 0);
      setCartCount(totalItems);
    };
    
    // Initial count
    updateCartCount();
    
    // Set up event listener for cart updates
    window.addEventListener('storage', updateCartCount);
    
    // Custom event for cart updates from within the app
    window.addEventListener('cartUpdated', updateCartCount);
    
    return () => {
      window.removeEventListener('storage', updateCartCount);
      window.removeEventListener('cartUpdated', updateCartCount);
    };
  }, []);
  
  const handleLogout = async (e) => {
    e.preventDefault();
    if (window.confirm('Are you sure you want to logout?')) {
      try {
        await logout();
        // Clear cart and any other stored data
        localStorage.clear();
        // Navigate to login page
        navigate('/login');
      } catch (error) {
        console.error('Error during logout:', error);
      }
    }
  };
  
  const handleTitleClick = () => {
    navigate('/');
  };

  return (
    <div className="navbar">
      <h1 onClick={handleTitleClick}>ConnecShop</h1>
      <nav>
        <ul>
          <li>
            <NavLink 
              to="/" 
              className={({ isActive }) => isActive ? 'active' : ''}
              data-tooltip="Home"
            >
              <img src="/icons/home.png" className="icon" alt="Home" />
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/search" 
              className={({ isActive }) => isActive ? 'active' : ''}
              data-tooltip="Search Products"
            >
              <img src="/icons/search.png" className="icon" alt="Search" />
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/cart" 
              className={({ isActive }) => isActive ? 'active' : ''}
              data-tooltip="Shopping Cart"
            >
              <img src="/icons/cart.png" className="icon" alt="Cart" />
              {cartCount > 0 && <span className="cart-badge">{cartCount}</span>}
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/chat" 
              className={({ isActive }) => isActive ? 'active' : ''}
              data-tooltip="Messages"
            >
              <img src="/icons/chat.png" className="icon" alt="Messages" />
            </NavLink>
          </li>
          <li>
            <NavLink 
              to="/profile" 
              className={({ isActive }) => isActive ? 'active' : ''}
              data-tooltip="Your Profile"
            >
              <img src="/icons/user.png" className="icon" alt="Profile" />
            </NavLink>
          </li>
          <li>
            <a 
              href="#" 
              onClick={handleLogout}
              data-tooltip="Logout"
            >
              <img src="/icons/logout.png" className="icon" alt="Logout" />
            </a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
